const expenseAmount = 11000;



  return (
    <div className='expense-item'>
      <div>{props.date.toISOString()}</div>

      <div className='expense-item__description'>
        <h2>{props.title}</h2>
        <div className='expense-item__price'>Rs {props.amount}</div>
